// Transformation de champs de table
def toDouble(s : String): Double = try { if (s.isEmpty) 0 else s.toDouble } catch {case e: Exception => 0}
def toInt(s : String): Int = if (s.isEmpty) 0  else s.toInt
def toBigInt(s : String): BigInt = if (s.isEmpty) BigInt(0) else BigInt(s)
def toLangage(s : String): String = if (s.isEmpty) "" else (s.split(";")(0).split(":")(1))
def toYear(s : String): Int = if (s.isEmpty) 0 else (s.slice(0, 0 + 4)).toInt
def toMonth(s : String): Int = if (s.isEmpty) 0 else (s.slice(4, 4 + 2)).toInt
def toDay(s : String): Int = if (s.isEmpty) 0 else (s.slice(6, 6 + 2)).toInt
def toEventCode(c1 : String, c2 : String, c3 : String): String = if (c3.isEmpty) "0" else if ((c3+"0")==c2) c3 else  if (c2==c1) c2 else c1
def TonePos(s : Double): Int = if (s >= 10) 1 else 0
def ToneNeg(s : Double): Int = if (s < -10) 1 else 0
def ToneNeu(s : Double): Int = if (s >= -10 & s < 10) 1 else 0
def TypeTone(s : Double): String = if (s >= 10) "Pos" else if (s < -10) "Neg" else "Neu"

